using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct MeleeAttackComponentResolver : IResolver<MeleeAttackComponent>, IResolver<MeleeAttackComponentResolver,MeleeAttackComponent>, IData	{		public MeleeAttackComponentResolver In(ref MeleeAttackComponent meleeattackcomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetMeleeAttackComponent();			Out(ref local);		}		public void Out(ref MeleeAttackComponent meleeattackcomponent)		{		}	}}